import React from 'react';

class Filter extends React.Component {

	render() {
		return(
			<nav className='filter'>
				Sort items:
				<ul>
					<li><button onClick={this.props.filterUpdate}>All</button></li>
					<li><button onClick={this.props.filterUpdate}>Web</button></li>
					<li><button onClick={this.props.filterUpdate}>Branding</button></li>
					<li><button onClick={this.props.filterUpdate}>Graphic</button></li>
				</ul>
			</nav>
		);
	}
}

export default Filter;
